import Button from './button';

function Fields(props) {
	// props.data.forEach(i => console.log(i))
  return (
		<>
			{
				props.data.map(i => {
					return (
						<div>
							<h1>{i.title}</h1>
							<p>{i.text}</p>
						</div>					
					)
				})
			}
		</>
	)
};

export default Fields;
